signal = ''

def unique_check(signal_chars):
    if len(signal_chars) == len(set(signal_chars)):
        return True
    else:
        return False
for i in range(0,len(signal)):
    signal_chars=[]
    for j in range(0,14):
        signal_chars.append(signal[i+j])
    if unique_check(signal_chars) == True:
        print(i+14)
        break
